adsApp.factory('postAds', ['$resource', function($resource){
    var resource =  $resource('http://localhost:1337/api/user/Ads/', {}, {
        post: {
            method: 'POST',
            headers: {
                'Authorization': 'Bearer ' + localStorage.access_token
            }
        }
    })
    function postAds(data)
    {

        if(data.imageDataUrl) {}
        else {
            data.imageDataUrl = 'data:image/jpg;base64,'
        }
        return resource.post(data);
    }

    return{
        postAd: postAds
    }

}])
